import React, { Component }  from 'react';
import { Form, Input, Button, Card, PageHeader } from 'antd';
import './index.less';

const layout = {
  labelCol: { span: 5 },
  wrapperCol: { span: 15 },
};
const tailLayout = {
  wrapperCol: { offset: 5, span: 15 },
};

class LoginPage extends Component {
  constructor(props) {
    super(props);
    this.state = {
    }
  }

  onFinish = values => {
    const { onLoginSuccess } = this.props;
    console.log(this.props);
    console.log('Success:', values);
    if (values.username === 'hahaha' && values.password === '20201023') {
      alert('登陆成功');
      onLoginSuccess();
    } else {
      alert('密码或用户名错误');
    }
  };

  onFinishFailed = errorInfo => {
    console.log('Failed:', errorInfo);
  };  

  render() {
    const { isLogin, isRegister, isUpdate } = this.props;
    const { onFinish, onFinishFailed } = this;

    let title = this.getPageHeaderTitle(isLogin, isRegister, isUpdate);

    return (
      <div className="login-page">
        <PageHeader
          className="login-page-header"
          onBack={() => null}
          title={title}
          subTitle="Flight Aware Monitoring Platform"
        />
        <Card
          hoverable
          style={{ width: '75%', marginTop: 20 }}
        >
          <Form
              {...layout}
              name="basic"
              initialValues={{ remember: true }}
              size="large"
              colon={false}
              style={{marginTop: 20}}
              onFinish={onFinish}
              onFinishFailed={onFinishFailed}
            >
              <Form.Item
                label="用户名"
                name="username"
                rules={[{ required: true, message: '请输入用户名' }]}
              >
                <Input />
              </Form.Item>

              <Form.Item
                label="密码"
                name="password"
                rules={[{ required: true, message: '请输入密码' }]}
              >
                <Input.Password />
              </Form.Item>

              <Form.Item {...tailLayout}>
                <Button type="primary" htmlType="submit">
                  登陆
                </Button>
              </Form.Item>
            </Form>
        </Card>
      </div>
    );
  }
}

export default LoginPage;
